import React from 'react'
import './Header.css';
import { Link } from 'react-router-dom';


function Header() {
  return (
  <nav className='header'>
    <Link to="/login">
    <img className="header_logo" src="https://pngimg.com/uploads/amazon/amazon_PNG11.png" alt=""/>
    </Link>
    </nav>
    );
}

export default Header
